

from collections import Counter

"""
Sliding window approach. O(n)
Similar probelm: 
min length of subarray which have sum larger than k
min length of subarray which have sum equal to k
"""


class Solution:
    def balancedString(self, s: str) -> int:
        counts = Counter(s)
        n = len(s)
        avg = n / 4

        # find shortest substring contains target
        target = {}
        for key in 'QWER':
            if counts[key] > avg:
                target[key] = counts[key] - avg
        if not target:
            return 0

        def satisified(target, count):
            for key in target:
                if count[key] < target[key]:
                    return False
            return True

        # min_len_required = sum(target.values())
        # min_len = len(s)
        # O(n^2)
        # for i in range(len(s)):
        #     if s[i] not in target:
        #         continue
        #     count = Counter()
        #     for j in range(i, len(s)):
        #         count[s[j]] += 1
        #         if satisified(target, count):
        #             cur_len = j - i + 1
        #             if cur_len == min_len_required:
        #                 return cur_len
        #             if cur_len < min_len:
        #                 min_len = cur_len
        #             break
        #         elif j - i + 1 >= min_len:
        #             break
        min_len = len(s)
        start = 0
        end = 0
        count = Counter()
        while end < len(s):
            while not satisified(target, count) and end < len(s):
                count[s[end]] += 1
                end += 1
            while satisified(target, count) and start < end:
                count[s[start]] -= 1
                start += 1
            min_len = min(min_len, end - start + 1)

        return min_len


if __name__ == '__main__':
    solution = Solution()
    cases = ["QWER", "QQWE", "QQQW", "QQQQ"]
    for s in cases:
        res = solution.balancedString(s)
        print(s, end=': ')
        print(res)

    s = ""
    print(solution.balancedString(s))
